package TestPackage1;

public class StarPrint11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int star=1;
		for(int i=1;i<=5;i++)
		{
			//System.out.print(" ");
		
			for(int j=1;j<=star;j++)
			{
		    System.out.print("*");
			}
		
		star++;
		System.out.println();
		}
	}

}
